import logo from './logo.svg';
import './App.css';
import {Outlet,Link} from 'react-router-dom';

function App() {
  const [arr,setArr]=useState([]);
    const [error, setError] = useState(null);
    let apiURL='https://667323296ca902ae11b33da7.mockapi.io/Electronics';
    useEffect(()=>{
        fetch(apiURL)
            .then((res)=>{
                if(!res.ok){
                    throw new Error('Network Response Error');
                }
                return res.json();
            })
            .then((data)=>{
                console.log("API Called");
                setArr(data);
                console.log(arr);
            })
            .catch((err)=>{
                throw new Error('API Response Error');
            })
    },[]);
  return (
    <>
      <nav className="navbar navbar-expand-lg bg-body-tertiary">
        <div className="container-fluid">
          <Link className="navbar-brand" to="/">DE</Link>
          <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarSupportedContent">
            <ul className="navbar-nav me-auto mb-2 mb-lg-0">
              <li className="nav-item">
                <Link className="nav-link active" aria-current="page" to="/">Home</Link>
              </li>
              <li className="nav-item">
                <Link className="nav-link" to="/profitLoss">P/L Statement</Link>
              </li>
              <li className="nav-item">
                <Link className="nav-link" to="/stock">Stock</Link>
              </li>
              <li className="nav-item">
                <Link className="nav-link" to="/stock/add">Add Stock</Link>
              </li>
            </ul>
          </div>
        </div>
      </nav>
      <Outlet />
    </>
  );
}

export default App;
